  render() {
    return (
      <div>
        <p>Статистика</p>
        <ul>
          <li>
            <span>Отлично</span>
            <span>this.state.good</span>
            Отлично
          </li>
          <li>Средне</li>
          <li>Плохо</li>
        </ul>
      </div>
    );
  }
}

